import {ReactComponent as GitHubIcon} from 'assets/img/github.svg'

function Navbar () {
    return (
        <header>
            <nav className="container">
                <div>
                    <h1>DSMovie</h1>
                    <a href='https://github.com/robertteixeira/dsmovie'>
                    <div>
                        <GitHubIcon/>
                        <p>/Robert's Dev</p>
                    </div>
                    </a>
                </div>
            </nav>
        </header>
    );
}

export default Navbar;
